**Autotune Class in C++**
=========================

### Overview

This is an example implementation of an Autotune class in C++. The Autotune effect is a vocal pitch correction technique that can be used to correct off-key singing or create a robotic vocal sound.

### Dependencies

* `cmath` for mathematical operations

### Implementation

